import { NavLink } from 'react-router-dom';

function Menu() {
  return (
    <nav>
      <NavLink
        className={({ isActive }) => (isActive ? 'activeLink' : 'link')}
        to="/"
        end
      >
        Home
      </NavLink>
      <NavLink to="/about">About</NavLink>
      <NavLink to="/contacts">Contacts</NavLink>
    </nav>
  );
}

export default Menu;
